webpackJsonp([0xb1ba7a7dc3fc],{1204:function(t,e){t.exports={data:{markdownRemark:{html:'<p>Product Hunt, threw zCast (<a href="https://zcast.co/">https://zcast.co/</a>) in my face this week, so I decided to give it a go as a way to record my own personal learning journal. As is always the way in tech, I screwed up. A listener chimed in that she couldn’t hear anything and so I repeated myself. Once I ended the zCast, I found that I had in fact been recording, though I’m still not sure which mic was being used. Anywhoodle, enjoy! (I’m also going to use this as a way to stop myself from using so many verbal pauses and smacking noises!)</p>\n<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 142.85714285714286%; position: relative; height: 0; overflow: hidden;"\n          >\n            <iframe style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          " src="https://zcast.co/embedded/09By9Z1BZn" scrolling="auto"></iframe>\n          </div>\n          </div>',frontmatter:{date:"September 07, 2016",path:"/blog/lxrepeat-trying-out-zcast-with-a-personal-learning-journal",title:"#LXRepeat: Trying out zCast with a Personal Learning Journal",tags:null,categories:["Showing my Work"],featured:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:1.7241379310344827,src:"/static/LXRepeat-36872601c909d46cf8895b69b20bfb18-7cb0e.png",srcSet:"/static/LXRepeat-36872601c909d46cf8895b69b20bfb18-98aaf.png 203w,\n/static/LXRepeat-36872601c909d46cf8895b69b20bfb18-6f1a5.png 405w,\n/static/LXRepeat-36872601c909d46cf8895b69b20bfb18-7cb0e.png 800w",sizes:"(max-width: 800px) 100vw, 800px"}}}}}},pathContext:{}}}});
